    </li>,
  ];
  if (props.isLoggedIn) {
    navBarItems.push(
      <li key={2}>
        <a href="/logout">Log Out</a>
      </li>
    );
  } else {
    navBarItems.push(
      <li key={3}>
        <a href="/signup">Sign Up</a>
      </li>
    );
    navBarItems.push(
      <li key={4}>
        <a href="/login">Log In</a>
      </li>
    );
  }

  return (
    <>
      <h1>Walk it out</h1>
